// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AutomationCompatibleInterface.sol";
import {IPrice} from "../oracle/interfaces/IPrice.sol";
import {IMarket} from "../market/interfaces/IMarket.sol";
import {IMarketValid} from "./../market/interfaces/IMarketValid.sol";

contract AutoLiq is AutomationCompatibleInterface {
    function getPrice(address market, bool isLong) private view returns (uint256) {
        return
            IPrice(IMarket(market).priceFeed()).getPrice(
                IMarket(market).indexToken(),
                !isLong
            );
    }

    function checkUpkeep2(
        address market,
        bool isLong
    ) private view returns (address[] memory accountsForLiquidate) {
        address[] memory accounts = IMarket(market)
            .positionBook()
            .getPositionKeys(0, 9999, isLong);
        address[] memory liqList = new address[](accounts.length);

        uint256 liqCount;
        uint256 i;
        for (; i < accounts.length; i++) {
            uint256 liqState = IMarketValid(IMarket(market).marketValid())
                .isLiquidate(
                    accounts[i],
                    market,
                    isLong,
                    IMarket(market).positionBook(),
                    IMarket(market).feeRouter(),
                    getPrice(market, isLong)
                );

            if (liqState == 0) continue;
            liqList[liqCount] = accounts[i];
            liqCount++;
        }

        accountsForLiquidate = new address[](liqCount);
        for (i = 0; i < liqCount; i++) accountsForLiquidate[i] = liqList[i];
    }

    function checkUpkeep(
        bytes memory checkData
    )
        external
        view
        override
        returns (bool upkeepNeeded, bytes memory performData)
    {
        address market = abi.decode(checkData, (address));
        address[] memory retLong = checkUpkeep2(market, true);
        address[] memory retShort = checkUpkeep2(market, false);
        if (retLong.length + retShort.length == 0) return (false, performData);
        return (true, abi.encode(market, retLong, retShort));
    }

    function performUpkeep(bytes memory performData) external override {
        (
            address market,
            address[] memory retLong,
            address[] memory retShort
        ) = abi.decode(performData, (address, address[], address[]));
        if (retLong.length > 0)
            IMarket(market).liquidatePositions(retLong, true);
        if (retShort.length > 0)
            IMarket(market).liquidatePositions(retShort, false);
    }
}

