// SPDX-License-Identifier: BUSL-1.1

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import {SafeCast} from "@openzeppelin/contracts/utils/math/SafeCast.sol";
import {OrderLib} from "./OrderLib.sol";

library Order {
    using SafeCast for uint256;
    using Order for Props;

    uint8 public constant STRUCT_VERSION = 0x01;

    //0. Keep leverage when the Take Profit order is triggered (0 for false, 1 for true)
    uint64 private constant EXTRA2_ADD_POS_KEEP_LEV_ON_TP_MASK =          0xFFFFFFFFFFFFFFF0; // prettier-ignore

    //1. Keep leverage when the Stop Loss order is triggered (0 for false, 1 for true)
    uint64 private constant EXTRA2_ADD_POS_KEEP_LEV_ON_SL_MASK =          0xFFFFFFFFFFFFFF0F; // prettier-ignore

    uint64 private constant EXTRA2_ADD_POS_KEEP_LEV_ON_SL_BIT_POS = 4;

    struct Props {
        uint8 version;
        uint32 updatedAtBlock;
        //***************************************************
        //             Definition of triggerAbove
        //---------------------------------------------------
        // value 0: INVALID;
        // value 2 or 4: triggerAbove is false;
        // value 1 or 3: triggerAbove is true;
        // value 1 or 2: fromMarket is false;
        // value 3 or 4: fromMarket is true;
        uint8 triggerAbove;
        //***************************************************

        address account;
        //***************************************************
        //             Definition of extra3
        //---------------------------------------------------
        // Open-Order meanings: isFromMarket(1 for true, 0 for false)
        // Close-Order meanings: isKeepLev
        uint48 extra3;
        //***************************************************

        //***************************************************
        //             Definition of collateral
        //---------------------------------------------------
        // Open-Order meanings: pay
        // Close-Order meanings: collateralDelta
        uint128 collateral;
        //***************************************************

        uint128 size;
        uint128 price;
        //***************************************************
        //             Definition of extra1
        //---------------------------------------------------
        // Open-Order meanings: take-profit
        // Close-Order meanings: NULL
        uint128 extra1;
        //***************************************************

        uint64 orderID;
        //***************************************************
        //             Definition of extra2
        //---------------------------------------------------
        // Open-Order meanings: keep leverage on tp/sl
        // Close-Order meanings: order to order id(as known as: pairKey)
        uint64 extra2;
        //***************************************************

        //***************************************************
        //             Definition of extra0
        //---------------------------------------------------
        // Open-Order meanings: stop-loss
        // Close-Order meanings: from order id
        uint128 extra0;
        //***************************************************

        bytes32 refCode; //160
        //96 todo uint96 extra4;
    }

    function setIsFromMarket(
        Props memory order,
        bool isIncrease,
        bool _isFromMarket
    ) internal pure {
        if (isIncrease) order.extra3 = uint48(_isFromMarket ? 1 : 0);
        else order.extra1 = uint128(_isFromMarket ? 1 : 0);
    }

    function isFromMarket(
        Props memory order,
        bool isIncrease
    ) internal pure returns (bool) {
        if (isIncrease) return order.extra3 > 0;
        return order.extra1 > 0;
    }

    function setSize(Props memory order, uint256 size) internal pure {
        order.size = size.toUint128();
    }

    function setTriggerAbove(
        Props memory order,
        bool triggerAbove
    ) internal pure {
        order.triggerAbove = triggerAbove ? 1 : 2;
    }

    function getTriggerAbove(Props memory order) internal pure returns (bool) {
        if (order.triggerAbove == 0) revert("invalid order trigger above");
        if (order.triggerAbove % 2 == 1) return true;
        else return false;
    }

    function setIsFromMarket(
        Props memory order,
        bool _isFromMarket
    ) internal pure {
        require(order.triggerAbove == 1 || order.triggerAbove == 2);
        if (_isFromMarket) order.triggerAbove += 2;
    }

    function getIsFromMarket(Props memory order) internal pure returns (bool) {
        return order.triggerAbove == 3 || order.triggerAbove == 4;
    }

    function isMarkPriceValid(
        Props memory order,
        uint256 markPrice
    ) internal pure returns (bool) {
        if (order.getTriggerAbove()) return markPrice >= uint256(order.price);
        else return markPrice <= uint256(order.price);
    }

    function setPrice(Props memory order, uint256 _p) internal pure {
        order.price = _p.toUint128();
    }

    //========================================
    //        extra0
    //========================================

    function setFromOrder(Props memory order, uint64 orderID) internal pure {
        order.extra0 = uint128(orderID);
    }

    function getFromOrder(Props memory order) internal pure returns (uint256) {
        return uint256(order.extra0);
    }

    function setStoploss(Props memory order, uint256 stoploss) internal pure {
        order.extra0 = stoploss.toUint128();
    }

    function getStoploss(Props memory order) internal pure returns (uint256) {
        return uint256(order.extra0);
    }

    //========================================
    //        extra1
    //========================================

    function setTakeprofit(Props memory order, uint256 tp) internal pure {
        order.extra1 = tp.toUint128();
    }

    function getTakeprofit(Props memory order) internal pure returns (uint256) {
        return order.extra1;
    }

    //================================================================================
    //        extra2 - Close-Order
    //================================================================================

    function setPairKey(Props memory order, uint64 orderID) internal pure {
        order.extra2 = orderID;
    }

    function getPairKey(Props memory order) internal pure returns (bytes32) {
        return OrderLib.getKey(order.account, order.extra2);
    }

    //================================================================================
    //        extra2 - Open-Order
    //================================================================================

    function setKeepLevOnTP(Props memory self, bool allow) internal pure {
        uint64 value = uint64(allow ? 1 : 0);
        self.extra2 =
            (self.extra2 & EXTRA2_ADD_POS_KEEP_LEV_ON_TP_MASK) |
            value;
    }

    function setKeepLevOnSL(Props memory self, bool allow) internal pure {
        uint64 value = uint64(allow ? 1 : 0);
        self.extra2 =
            (self.extra2 & EXTRA2_ADD_POS_KEEP_LEV_ON_SL_MASK) |
            (value << EXTRA2_ADD_POS_KEEP_LEV_ON_SL_BIT_POS);
    }

    function getKeepLevOnTP(Props memory self) internal pure returns (bool) {
        return (self.extra2 & ~uint64(EXTRA2_ADD_POS_KEEP_LEV_ON_TP_MASK)) != 0;
    }

    function getKeepLevOnSL(Props memory self) internal pure returns (bool) {
        uint64 value = (self.extra2 & ~EXTRA2_ADD_POS_KEEP_LEV_ON_SL_MASK) >>
            EXTRA2_ADD_POS_KEEP_LEV_ON_SL_BIT_POS;
        return value != 0;
    }

    //========================================
    //        extra3
    //========================================

    function setIsKeepLev(Props memory order, bool isKeepLev) internal pure {
        order.extra3 = isKeepLev ? 1 : 0;
    }

    function getIsKeepLev(Props memory order) internal pure returns (bool) {
        return order.extra3 > 0;
    }

    //========================================

    function validTPSL(Props memory _order, bool _isLong) internal pure {
        if (_order.getTakeprofit() > 0) {
            require(
                _order.getTakeprofit() > _order.price == _isLong,
                "OrderBook:tp<price"
            );
        }
        if (_order.getStoploss() > 0) {
            require(
                _order.price > _order.getStoploss() == _isLong,
                "OrderBook:sl>price"
            );
        }
    }

    function getKey(Props memory order) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked(order.account, order.orderID));
    }

    function updateTime(Order.Props memory _order) internal view {
        _order.updatedAtBlock = uint32(block.timestamp);
    }

    function validOrderAccountAndID(Order.Props memory order) internal pure {
        require(order.account != address(0), "invalid order key");
        require(order.orderID != 0, "invalid order key");
    }
}

